import React, { useContext } from "react";
import { UserFname, UserLname } from "./CompoHookA";

// This Way With Hook Context Using

function CompoHookD() {
  const Fname = useContext(UserFname);
  const Lname = useContext(UserLname);
  return (
    <div>
      CompoHookD Using Hook Context U Fname is {Fname} And U Lname is {Lname}
    </div>
  );
}

export default CompoHookD;
